import { Directory } from './file.utils';
import { FileExtension, FileType, findFileType, JpgFile, TxtFile } from './file.util.model';
// eslint-disable-next-line @typescript-eslint/no-var-requires
const appRootPath = require('app-root-path');

describe('', () => {


    it('AppRootPath 라이브러리 테스트', async () => {
        const appRootPath = await import('app-root-path');
        console.log(appRootPath.path);
    });

    it('생성', () => {
        const directory = new Directory('data', 'a',  'b', 'c');
        console.log(directory.pwd());
        console.log(directory.parent());
        directory.parent().clear();
    });

    it('현재 작업 경로 출력', () => {
        const directory = new Directory('data');
        expect(directory.pwd()).toEqual(`${appRootPath.path}/data`);
    });

    it('Parent Directory', () => {
        const directory = new Directory('data');
        expect(directory.parent().pwd()).toEqual(`${appRootPath.path}`);
        expect(directory.parent().parent().pwd()).toEqual(`${appRootPath.path}`);
    });

    it('파일 저장 테스트', () => {
        const directory = new Directory('data');
        directory.addJSON('test.json', { name: 'Apple', color: 'Red' });
    });

    it('파일 삭제 테스트', () => {
        const directory = new Directory('data', 'child', 'child2');
        const child = directory.parent();
        child.clear();
    });

    it('파일 타입 테스트', () => {
        expect(findFileType('hello.txt').extension).toEqual(FileExtension.TXT);
    });

    it('파일 읽기 테스트', () => {
        const directory = new Directory('data');
        directory.clear();
        directory.add(new TxtFile('hello.txt', 'hello world'));
        const customFiles: TxtFile[] = <TxtFile[]> directory.readFiles(FileExtension.TXT);
        expect(customFiles.length).toEqual(1);
    });

    it('텍스트 파일 저장', () => {
        const directory = new Directory('data');
        directory.clear();
        directory.add(new TxtFile('fruit.txt', 'Apple'));
        const customFiles: TxtFile[] = <TxtFile[]> directory.readFiles(FileExtension.TXT);
        expect(customFiles.length).toEqual(1);
    });

    it('이미지 파일 저장', () => {

        const base64 = '';
        
        const directory = new Directory('data');
        directory.clear();
        directory.add(new JpgFile('fruit.jpg', base64));
        const customFiles: JpgFile[] = <JpgFile[]> directory.readFiles();
        expect(customFiles.length).toEqual(1);
    });


});